script: |
  super -f text -I q24.spq | sort > q24.out

inputs:
  - name: q24.spq
    data: |
      SELECT - col1 + - 68 / + - col0 AS col0 FROM tab1 (FORMAT parquet) AS cor0 WHERE + col2 * - 89 + - col2 NOT IN ( - - col2 * - col1 - + col0 + + - col1 + - col2, + col1 );
  - name: tab1

outputs:
  - name: q24.out
    data: |
      -13
      -47
      -5
